window.bookSummaryJSON = "<p>Myfanwy Thomas awakes in a London park surrounded by dead bodies. With her memory gone, her only hope of survival is to trust the instructions left in her pocket by her former self. She quickly learns that she is a Rook, a high-level operative in a secret agency that protects the world from supernatural threats. But there is a mole inside the organization - and this person wants her dead. </p> <p>As Myfanwy battles to save herself, she encounters a person with four bodies, a woman who can enter her dreams, children transformed into deadly fighters, and an unimaginably vast conspiracy. </p> <p>Suspenseful and hilarious, <i>The Rook</i>is an outrageously inventive debut for listeners who like their espionage with a dollop of purple slime.</p>"; 
